        this.state = {
          value: 30,
        };
      }
    render() {
      return (
        <div className="shopping-list">
          <h1 >Shopping List for </h1>
          <ul>
            <li onClick={() => alert(this.props.value)}>Instagram</li>
            <li>WhatsApp</li>
            <li>Oculus</li>
          </ul>
        </div>
      );
    }
  }
  export default  ShoppingList;
